import React from 'react';
import SpyLogo from './spyLogo.jpg';

class Welcome extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className="welcome">
                <h1 align="center">Hello Agent</h1>
                <img className="app-logo" src={SpyLogo} />
            </div>
        );
    }
}

export default Welcome;
